fields.description:
For an object type under a parent scope, modify the list of rules used to determine which objects are excluded from metadata collection. **Example:** To exclude ingestion for the 'analytics' project and all projects that start with 'prod_', make a request with these variables: {
            "parentScope": {
                "resourceId": "9ed28eb2-6d21-4ad3-9d87-c05a3cb0f7e2"
            },
            "targetObjectType": "project",
            "collectionBlocks": [
                {
                    "resourceId": "9ed28eb2-6d21-4ad3-9d87-c05a3cb0f7e2",
                    "project": "analytics",
                    "matchType": "exact_match"
                },
                {
                    "resourceId": "9ed28eb2-6d21-4ad3-9d87-c05a3cb0f7e2",
                    "project": "prod_",
                    "matchType": "prefix"
                }
            ]
        }
